import React from 'react';
import './Panel.css'

const Panel = () => {
    return (
        <div className="PNL">
            <img alt='pokemon img' src='https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/1.png'></img>
            <div>
                <h2>Balbusar</h2>
                <p>Id: 1</p>
                <p>Type: Grass</p>
            </div>
        </div>
    );
}

export default Panel;
